import React from "react";
import "../../styles/Navbar.css"

function Navbar(props) {
  return (
    <nav className="navbar">
      <ul>
        <li></li>
        <li>{props.status}</li>
        <li>Score: {props.score} | High Score: {props.highScore}</li>
      </ul>
    </nav>
  );
}

export default Navbar;
